func _mockHTTP(rsp []byte) (string, int) {
	addr := utils.GetRandomLocalAddr()
	time.Sleep(time.Second)
	var host, port, _ = utils.ParseStringToHostPort(addr)
	go func() {
		lis, err := net.Listen("tcp", addr)
		if err != nil {
			panic(err)
		}
		conn, err := lis.Accept()
		if err != nil {
			return
		}
		conn.Write(rsp)
		wait500ms()
		conn.Close()
		lis.Close()
	}()
	time.Sleep(time.Second)
	return host, port
}

